import contacts from "../contacts.js";
// import Contacts from "../contacts.jsx";
function Capp(props) {
  return (
   <div> 
    <div className="card">
      <div className="top"></div>
          <h2>{props.name}</h2>
          <img
            src={props.imgURL}
            alt="avatar_img"/>
      </div>

        <div className="bottom">
          <p>{props.phone}</p>
          <p>{props.email}</p>
        </div>
    </div>
  );
};
var len = {contacts:contacts[0]};
