for (var c=0; c<= len; c++){
  var con= {contacts}[c];
  console.log({con});
  console.log({contacts:contacts[c]});
  <Capp 
  name= {{contacts:contacts[c]}.name} 
  img= {{contacts:contacts[c]}.imgURL} 
  phone= {{contacts:contacts[c]}.phone} 
  email= {{contacts:contacts[c]}.email}  
  />
}

export default Capp;
